import React, { useEffect, useState } from 'react';
import {
  Box, Button, Container, TextField, Typography, List, ListItem, ListItemText, MenuItem, Select, FormControl, InputLabel,
} from '@mui/material';

const BACKEND_URL = 'http://localhost:5000/api';

function App() {
  const [tasks, setTasks] = useState([]);
  const [title, setTitle] = useState('');
  const [desc, setDesc] = useState('');
  const [status, setStatus] = useState('todo');
  const [searchQuery, setSearchQuery] = useState('');
  const [searchResults, setSearchResults] = useState([]);

  useEffect(() => {
    fetchTasks();
  }, []);

  function fetchTasks() {
    fetch(`${BACKEND_URL}/tasks`)
      .then(res => res.json())
      .then(data => {
        setTasks(data);
        localStorage.setItem('tasks', JSON.stringify(data));
      })
      .catch(() => {
        // fallback: load from localStorage if offline or server down
        const cached = localStorage.getItem('tasks');
        if (cached) setTasks(JSON.parse(cached));
      });
  }

  function addTask() {
    if (!title.trim() || !desc.trim()) return;

    const newTask = { title, description: desc, status };
    fetch(`${BACKEND_URL}/tasks`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(newTask),
    })
      .then(res => {
        if (!res.ok) throw new Error('Failed to add task');
        return res.json();
      })
      .then(task => {
        setTasks(prev => [...prev, task]);
        localStorage.setItem('tasks', JSON.stringify([...tasks, task]));
        setTitle('');
        setDesc('');
        setStatus('todo');
      })
      .catch(err => alert(err.message));
  }

  function deleteTask(id) {
    fetch(`${BACKEND_URL}/tasks/${id}`, { method: 'DELETE' })
      .then(res => {
        if (!res.ok) throw new Error('Failed to delete task');
        setTasks(prev => prev.filter(t => t.id !== id));
        localStorage.setItem('tasks', JSON.stringify(tasks.filter(t => t.id !== id)));
      })
      .catch(err => alert(err.message));
  }

  function searchTasks() {
    if (!searchQuery.trim()) return setSearchResults([]);
    fetch(`${BACKEND_URL}/tasks/search?q=${encodeURIComponent(searchQuery)}`)
      .then(res => res.json())
      .then(results => setSearchResults(results))
      .catch(() => setSearchResults([]));
  }

  return (
    <Container maxWidth="sm" sx={{ mt: 4 }}>
      <Typography variant="h4" mb={2}>Task Manager</Typography>

      <Box mb={2}>
        <TextField
          label="Title"
          fullWidth
          value={title}
          onChange={e => setTitle(e.target.value)}
          margin="dense"
        />
        <TextField
          label="Description"
          fullWidth
          value={desc}
          onChange={e => setDesc(e.target.value)}
          margin="dense"
        />
        <FormControl fullWidth margin="dense">
          <InputLabel>Status</InputLabel>
          <Select
            value={status}
            label="Status"
            onChange={e => setStatus(e.target.value)}
          >
            <MenuItem value="todo">Todo</MenuItem>
            <MenuItem value="in progress">In Progress</MenuItem>
            <MenuItem value="done">Done</MenuItem>
          </Select>
        </FormControl>
        <Button variant="contained" onClick={addTask} sx={{ mt: 1 }}>Add Task</Button>
      </Box>

      <Typography variant="h6">All Tasks</Typography>
      <List>
        {tasks.map(task => (
          <ListItem
            key={task.id}
            secondaryAction={
              <Button color="error" onClick={() => deleteTask(task.id)}>Delete</Button>
            }
          >
            <ListItemText
              primary={`${task.title} (${task.status})`}
              secondary={task.description}
            />
          </ListItem>
        ))}
      </List>

      <Box mt={4}>
        <TextField
          label="Search tasks by description"
          fullWidth
          value={searchQuery}
          onChange={e => setSearchQuery(e.target.value)}
          onKeyDown={e => { if (e.key === 'Enter') searchTasks(); }}
          margin="dense"
        />
        <Button variant="outlined" onClick={searchTasks} sx={{ mt: 1 }}>Search</Button>

        {searchResults.length > 0 && (
          <>
            <Typography variant="h6" mt={2}>Search Results</Typography>
            <List>
              {searchResults.map(task => (
                <ListItem key={task.id}>
                  <ListItemText
                    primary={`${task.title} (${task.status})`}
                    secondary={task.description}
                  />
                </ListItem>
              ))}
            </List>
          </>
        )}
      </Box>
    </Container>
  );
}

export default App;
